import React from 'react';
import { motion } from 'framer-motion';
import { Card, CardContent } from '../components/ui/card';
import { Button } from '../components/ui/button';
import { Carousel } from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css';
import { FaInstagram, FaEnvelope } from 'react-icons/fa';

const PrimecutStudio = () => {
    const handleBookStudioClick = () => {
        const contactSection = document.getElementById("contact-section");
        if (contactSection) {
            contactSection.scrollIntoView({ behavior: "smooth" });
        }
    };
    const openInstagram = () => {
        window.open("https://www.instagram.com/prime_cutstudios/", "_blank");
    };

    const openEmail = () => {
        window.open("mailto:studiosprimecut@gmail.com/","_blank");
    };
    return (
        <div className="min-h-screen bg-black text-white overflow-hidden">
            {/* Hero Section */}
            <div className="relative h-screen flex flex-col justify-center items-center px-8 bg-[url('./studio-bg.jpg')] bg-cover bg-center bg-fixed">
                <h1 className="text-5xl lg:text-7xl font-bold mb-4 text-center">PrimecutStudio</h1>
                <p className="text-lg lg:text-2xl mb-8 text-center">Where Creativity Meets Precision</p>
                <Button onClick={handleBookStudioClick} className="px-6 py-3 bg-red-500 hover:bg-red-600 rounded-2xl text-white font-semibold">Book Your Studio Now</Button>
                {/* Floating Elements */}
                <motion.img src="/tripod.png" alt="Tripod" className="absolute top-30 right-10 w-44" animate={{ y: [0, -20, 0] }} transition={{ duration: 4, repeat: Infinity, repeatType: "mirror" }} />
                <motion.img src="/camera.png" alt="Camera" className="absolute bottom-16 left-16 w-64" animate={{ y: [0, -20, 0] }} transition={{ duration: 3, repeat: Infinity, repeatType: "mirror" }} />
            </div>

            {/* About Section */}
            <div className="px-8 py-20 bg-gray-900">
                <h2 className="text-4xl font-semibold mb-6 text-center">Why Choose PrimecutStudio?</h2>
                <p className="text-xl text-center max-w-3xl mx-auto">From professional long-form content to viral short-form reels, we provide the perfect space and technical support to bring your vision to life. We also offer full video editing services to make your content truly stand out.</p>
            </div>

            {/* Image Carousel */}
            <div className=" bg-gray-900 h-[600px]">
                {/* <h1>Hello</h1> */}
                <Carousel autoPlay infiniteLoop showThumbs={false} showStatus={false} className="h-[600px]">
                    <div className=''>
                        <img src="./studio1.jpg" className="h-[600px] max-w-[700px]" alt="Studio 1" />
                        <div className="absolute inset-0 flex items-center justify-center bg-black bg-opacity-50 rounded-2xl">
                            <h2 className="text-4xl text-white font-bold">Capture the Moment</h2>
                        </div>
                    </div>
                    <div>
                        <img src="/studio2.jpg" className="h-[600px] max-w-[700px]" alt="Studio 2" />
                        <div className="absolute inset-0 flex items-center justify-center bg-black bg-opacity-50 rounded-2xl">
                            <h2 className="text-4xl text-white font-bold">Create with Confidence</h2>
                        </div>
                    </div>
                    <div>
                        <img src="/studio3.jpg" className="h-[600px] max-w-[700px]" alt="Studio 3" />
                        <div className="absolute inset-0 flex items-center justify-center bg-black bg-opacity-50 rounded-2xl">
                            <h2 className="text-4xl text-white font-bold">Unleash Your Creativity</h2>
                        </div>
                    </div>
                    <div>
                        <img src="/studio4.jpg"className="h-[600px] max-w-[700px]"  alt="Studio 4" />
                        <div className="absolute inset-0 flex items-center justify-center bg-black bg-opacity-50 rounded-2xl">
                            <h2 className="text-4xl text-white font-bold">Your Space, Your Story</h2>
                        </div>
                    </div>
                </Carousel>
            </div>

            {/* Services Section */}
            <div className="px-8 py-20 bg-gray-800 grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
                <Card>
                    <CardContent>
                        <h3 className="text-2xl font-bold mb-2">Video Shoots</h3>
                        <p>Capture professional-grade videos with state-of-the-art equipment and lighting setups. Whether it's a cinematic YouTube video, high-energy reel, or professional brand shoot, we've got you covered.High-quality shooting for YouTube, reels, and professional videos.</p>
                        <img src="/shootingservice.png" alt="Video Shoots" className="w-54 h-54 mx-auto mt-4" />
                    </CardContent>
                </Card>
                <Card>
                    <CardContent>
                        <h3 className="text-2xl font-bold mb-2">Editing Services</h3>
                        <p>Transform raw footage into polished, impactful content. Our expert editors enhance your videos with precision cuts, color grading, sound design, and stunning visual effects.Professional video editing to make your content shine.</p>
                        <img src="/Editing.png" alt="Video Shoots" className="w-54 h-54  mx-auto mt-4" />
                    </CardContent>
                </Card>
                <Card>
                    <CardContent>
                        <h3 className="text-2xl font-bold mb-2">Content Strategy</h3>
                        <p>Plan your content with confidence. We help you craft impactful stories, manage publishing schedules, and optimize your creative approach for maximum engagement. Helping you plan and execute your creative ideas.</p>
                        <img src="/content.png" alt="Video Shoots" className=" mx-auto mt-4" />
                    </CardContent>
                </Card>
            </div>

               {/* Contact Section */}
               <div id="contact-section" className="px-8 py-20 bg-black text-center">
                <h2 className="text-4xl font-semibold mb-6">Ready to Create?</h2>
                <div className="flex flex-col md:flex-row gap-4 justify-center">

                <Button onClick={openInstagram} className="px-6 py-3 w-48 bg-red-500 hover:bg-red-600 rounded-2xl text-white font-semibold mr-4">
                <FaInstagram className="mr-4" /> Instagram </Button>
                
                <Button onClick={openEmail} className="px-6 py-3 w-48 bg-blue-600 hover:bg-blue-700 rounded-2xl text-white font-semibold">
                <FaEnvelope className="mr-4" /> Email Us </Button>
                </div>
            </div>

            {/* Footer Section */}
            <footer className="px-8 py-8 bg-gray-900 text-center text-gray-500">
                <p>Contact us at: +91 78790 84754  | studiosprimecut@gmail.com</p>
                <p>&copy; 2025 PrimecutStudio. All rights reserved.</p>
            </footer>
        </div>
    );
};

export default PrimecutStudio;
